export default function News(props) {

    console.log(props);

    return (
        <div className="news">

            <div className="news-img">
                <img src={props.article.urlToImage}></img>
            </div>

            <h2>{props.article.title}</h2>
            <p>{props.article.description}</p>
            <a href="#">Read more</a>
            <div className="source">
                <p>Author : {props.article.author}</p>
                <p>Mi Pub</p>
            </div>

        </div>
    );

}
